import React from 'react';
import { Typography } from '@mui/material';

const Home = () => {
  return (
    <div>
      <Typography variant="h2">Welcome to Our School</Typography>
      <Typography variant="body1">Shaping future leaders.</Typography>
    </div>
  );
};

export default Home;
